Job Description:
QA Production Data Analyst


Job Ref: 53295
Category: Quality Assurance
Department: INFORMATION TECHNOLOGY
Location:

160 Water St. #3, New York, NY
Job Type: Regular
Employment Type: Full-Time
Hire In Rate: $70,000.00
Salary Range: $70,000.00 - $70,000.00
Marketing Statement
MetroPlus Health Plan provides the highest quality healthcare services to residents of Bronx, Brooklyn, Manhattan, Queens and Staten Island through a comprehensive list of products, including, but not limited to, New York State Medicaid Managed Care, Medicare, Child Health Plus, Exchange, Partnership in Care, MetroPlus Gold, Essential Plan, etc. As a wholly-owned subsidiary of NYC Health + Hospitals, the largest public health system in the United States, MetroPlus’ network includes over 27,000 primary care providers, specialists and participating clinics. For more than 30 years, MetroPlus has been committed to building strong relationships with its members and providers to enable New Yorkers to live their healthiest life.

Position Overview

Assess systems with a highly analytical approach, along with a problem-solving ability to determine, recommend and implement solutions regarding systems, databases and process efficiencies
Job Description
Ability to analyze and troubleshoot Production issues in and Microsoft Office including Access and iSeries/AS400;
Perform all applicable QA on every production job processed;
Analyze data in which the information will be presented, distributed, and accessed;
Create and maintain customized queries, batch scripts and data extracts as required;
Work with Operational areas to achieve mutual data and technical needs. Adhere to mandated response times as outlined in the MetroPlus policies and procedures;
Interact with Production staff, vendors, IT developers and MetroPlus business areas to troubleshoot and correct system/data problems;
Provide recommendations to supervisor to improve system/application performance;
Identify any potential quality issues per defined process and escalate potential quality issues immediately to management;
Ensure the quality of the processes meet the specifications and requirements;
Maintain up to date documentation on parameters for successful execution of these production processes;
Maintain up to date operation status logs and data repositories related to Production QA;
Implement vendor board/off-boarding
Minimum Qualifications
A Baccalaureate Degree from an accredited college or university; and
Five (5) years of progressive, responsible experience in the field of data processing, computer systems and applications;
Previous healthcare related work setting is preferable;
Knowledge and understanding of HIPAA;
Knowledge and expertise in the characteristics of computers, peripheral devices, communications systems and hardware capabilities, programming languages, IT applications, systems analysis methodology, data management and retrieval techniques; or a satisfactory equivalent combination of training, education and experience.
Professional Competencies
Three (3) to (5) five years’ experience with system design;
Strong knowledge of Microsoft Access;
Quality Assurance experience;
Background in data analysis;
Knowledge of Managed Health Care Systems;
Excellent verbal and written communication skills;
Excellent analytical ability;
Excellent customer services, interpersonal and time management skills;
Knowledge of MS SQL is a plus;
Knowledge of Batch scripting is a plus;
Ability to learn new software tools.

Chicago Public Schools (CPS) is the third largest school district in the United States, serving over 350,000 students in 600 schools and employing nearly 36,000 people, most of them teachers. CPS has set ambitious goals to ensure that every student, in every school and every neighborhood, has access to a world-class learning experience that prepares each for success in college, career and civic life. In order to fulfill this mission we make three commitments to our students, their families and all Chicagoans: academic progress, financial stability and integrity. Six core values are embedded within these commitments – student centered, whole child, equity, academic excellence, community partnership and continuous learning.

Reporting to the Director of Compliance & Training in the Office of Student Protections and Title IX, which now includes the Equal Opportunity Compliance Office, the Data Analyst is responsible for managing the collection, evaluation, and reporting of data to ensure that our protection processes and responses are in line with district compliance standards.

The Data Analyst will be held accountable for the following responsibilities:
Understand data to extract information aligned to business requirements;
Perform analysis on complex data sets to provide relevant and actionable information;
Evaluate data for integrity and consistency;
Identify anomalies in data to trace the source of inaccuracies;
Identify data trends to recommend best practices and process improvements;
Summarize data to provide topline reports and graphic representation through dashboards and presentations;
Develop, implement, and manage data collection systems and other strategies to optimize data collection efficiency and data quality;
Continuously locate and define new process improvement opportunities for the collection and reporting of data;
Partner with subject matter experts to identify additional data needs; and
Performs additional ad hoc duties as assigned.
Type of Education Required:
Bachelor's degree from an accredited college or university.
Master’s degree a plus.
Type of Experience Required:
Minimum of 3-5 years of data mining and data analysis experience
Knowledge, Skills and Abilities:
Expertise in applying a variety of statistical techniques to interpret and analyze data;
Expert user of Microsoft and Google office suites;
Ability to write advanced queries and produce reports;
Ability to acquire data from primary or secondary data sources;
Ability to maintain databases;
Ability to create pivot tables;
Strong analytical, organizational, and communication skills;
Refined judgement with the ability to manage highly sensitive and confidential information.
Ability to bring projects to a close with minimal supervision;
Ability to work in a fast paced environment, respond immediately to multiple constituencies, and meet continuous critical deadlines;
Ability to build relationships, establish collaborative partnerships, and work with a wide range of constituencies with diplomacy and tact;
Skilled multi-tasker and excellent time manager;
Ability to simultaneously achieve multiple goals and manage multiple projects; and
Excellent attention to detail and the ability to produce consistent high-quality work;
Residency Requirement:

As a condition of employment with the Chicago Public Schools (CPS), employees are required to live within the geographic boundaries of the City of Chicago within six months of their CPS hire date and maintain residency throughout their employment with the district.

Overview


As a Data Analyst, the primary responsibility is to acquire and transform clinical and health data from Inovalon’s technical platforms and databases to create impactful, dynamic, and insightful healthcare data analytics such as opportunity analyses, pharma reports/ extracts and program evaluation studies, customer reporting, product development, and ad-hoc analytics.

Responsibilities
Performs detailed statistical analyses and modeling of clinical and operational data with outputs that are clear and relevant to the users;
Participates in the design and development of analyses and reports that explore and present large amounts of data to discover underlying patterns and trends related to quality, safety, and clinical performance;
Works with information from a variety of sources, including the Specialty Pharmacy and Pharma data, and other sources using a variety of highly-specific tool such as, but not limited to, Oracle, SQL or Tableau;
Develop requirements for data mapping and data loading processes. Execute data mapping/loading requirements and reconciliation of such activities;
Assist with the design of data integration strategies, develop intuitive designs, and build enterprise interactive dashboards with built in guided healthcare data analytics;
Identify and research anomalies and outliers in data. Identify problematic areas and conduct research to determine the best course of action to correct the data;
Monitor and perform trend analysis for the company and research report on anomalies Maintain compliance with Inovalon’s policies, procedures and mission statement;
Maintain compliance with Inovalon’s policies, procedures and mission statement;
Adhere to all confidentiality and HIPAA requirements as outlined within Inovalon’s Operating Policies and Procedures in all ways and at all times with respect to any aspect of the data handled or services rendered in the undertaking of the position; and
Fulfill those responsibilities and/or duties that may be reasonably provided by Inovalon for the purpose of achieving operational and financial success of the Company.
Qualifications


Job Requirements:
At least 3 years of experience in data analytics, data science, or related field;
Experience with data management and visualization tools, such as SQL and Tableau, Power BI, and Oracle APEX;
Possession of strong analytical / statistical skills used in evaluating and analyzing data;
Strong organization skills and attention to details, comfortable working with minimum direction;
Adaptable to changing organizational requirements and priorities and supportive of a diverse work force;
Ability to collaborate with others in diplomatic, tactful manner, while exercising sensitivity and discretion as needed;
Specialty Pharmacy and/ or Pharma Industry Experience is preferred;
Advanced PC skills (Excel, PowerPoint, Word, Visio, and other programs); and
Excellent written and verbal communication skills.
Education:
Bachelor’s degree in Information Systems, Computer Science, Statistics, Analytics, or a related field of study;
Physical Demands and Work Environment:
Sedentary work ( i.e. sitting for long periods of time) Exerting up to 10 pounds of force occasionally and/or negligible amount of force;
Frequently or constantly to lift, carry push, pull or otherwise move objects and repetitive motions
Subject to inside environmental conditions; and
Travel for this position will include less than 5% locally usually for training purposes.
Inovalon provides equal employment opportunities (EEO) to all employees and applicants for employment. All qualified applicants will receive consideration for employment without regard to race, color, religion, sex, national origin, or protected veteran status and will not be discriminated against on the basis of disability.

